import React, { useState, useEffect } from 'react';
import { color, font } from '../../layout/main';
import uuid from 'uuid/v1';

const Title = () => {
  const [queque, setQueque] = useState([]);
  useEffect(()=> {
    const arr = Array(50).fill("GREENPOST'S");
    setQueque(arr);
  },[])
  return(
    <div>
      <ul>
        {
          queque.map((word, i) => <li key={uuid()}>{word}</li>)
        }
      </ul>
      <style jsx >{`
          div{
            overflow: hidden;
          }
        ul{
          margin: 0;
          padding: 1rem;
          color: ${color.prim};
          display: flex;
          align-items: center;
        }
        li{
          flex-shrink: 0;
          margin: 0 1rem;
        }
      `}
      </style>
    </div>
  )
}

const Main = () => {
  return(
    <div>

      <style jsx>{`
        div{
          overflow: hidden;
          border: 1px solid red;
        }
      `}
      </style>
    </div>
  )
}

export default Main;
